import React from 'react'


const Table = ({ bodyTitle }) => {

  let headerResult;
  let list = []
  for (let i = 0; i < bodyTitle.length; i++) {
    if (i !== 0) {
      headerResult = bodyTitle[i].map((el) => {
        return <td>{el}</td>
      })
    }
    list.push(headerResult);
  }

  const result = list.map((l) => {

    console.log(l);
    return <tr>
      <td><input type="checkbox" /></td>
      {l}
    </tr>
  })

  // console.log(bodyResult);
  // console.log(list);
  // const headerResult = headerTitle.map((el) => {
  //   return <td key={el.id}>{el.title}</td>
  // })

  // const bodyResult = bodyTitle.map((el, index) => {
  //   return <tr key={index}>
