  //     {
  //       el.map((e) => {
  //         return <td key={e.id} className={`TD-${e.id} ${e.state}`}>{e.title}</td>
  //       })
  //     }
  //   </tr>
  // })

  return (
    <div style={{ overflow: "auto" }}>
      <table className='table-dashboard table-main' >
        <thead>
          <tr>
            <th><input type="checkbox" /></th>
            <th>#</th>
            <th>اسم العميل</th>
            <th>تاريخ الطلب</th>
            <th>الدفع</th>
            <th>الشحن</th>
            <th>المجموع</th>
            <th>حالة الطلب</th>
          </tr>
          <tr>
            <th><input type="checkbox" /></th>
            <th>A</th>
            <th>B</th>
            <th>C</th>
            <th>D</th>
            <th>D</th>
            <th>A</th>
            <th>B</th>
            <th>C</th>
          </tr>
        </thead>
        <tbody>
          {result}
          <tr>
            <td className='table-more' colSpan="9">
              <a href='#' >المزيد من الطلبات</a>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default Table;
